Niko en de Vliegende Brigade (2008)

Finland / Denemarken / Ierland / Duitsland
Animatie / Familie
75 minuten

geregisseerd door Michael Hegner en Kari Juusonen

Een klein rendierjongetje, genaamd Niko, droomt ervan om net zo te vliegen als zijn vader die hij nog nooit ontmoet heeft. Ondanks dat hij last heeft van hoogtevrees en duizeligheid, gaat hij er toch op uit om vlieglessen te krijgen van Julius, een Finse vliegende eekhoorn.


